function helpAddPeriod(title,Lessonid,lessonDescribe,startTime,endTime){


        $.ajax({
              dataType:'json',
              type:'POST',
              async:false, 
              data:{title:title,
                    lessonId:Lessonid,
                    classNo:1,
                    lessonDescribe:lessonDescribe,
                    startTime:startTime,
                    endTime:endTime
                  },       
              url: 'http://211.159.152.210:8188/AreTalkServer/Web/Api/addLessonDetailClass.action;jsessionid='+Sessionid,
              success:function(data) {

                if (data.errCode==0) {
                   console.log("helpAddPeriod success") 
                   helpStarLesson(Lessonid)
                   
                 }       
                  },
              error:function(data) {
                    alert("失败，请重试")
                  }    
              }); 
}; 



